import React from "react";
function PosteVote({post ,choix ,setChoix}) {


return (
    <>
    
    <div className="vote">
        <h4 className="dateNote">{post.date}</h4>
        <div className="voteshadow">
          <p className="titleVote">cvb</p>
        
          {choix.map((choi) =>

             <div className="scroll">
             <div className="choix">
             <input type="radio"  name="radio" className="check"/>
             <input type="text"  className="value" readOnly />
             </div>
             <p className="resulta1">+1</p>
         </div>
        )}

        </div>
      </div>

      
    
      
    </>
  );
  
}

export default PosteVote;
